    return(

        <div className='game'>
        <button onClick={(e) => {
          logMyProps(e);
        }}>log props</button>

            <div>
                {props.name}
            </div>
            <div>
                {props.beat}
            </div>
            <div>
                {props.desireToPlay}
            </div>
            <div>
                {props.icon}
            </div>
            <div>
                {props.owned}
            </div>
            <div>
                {props.platform}
            </div>

        </div>


    )
}

